import React, { useState, useEffect } from 'react';
import { 
  TextField, 
  Autocomplete, 
  Paper, 
  Typography, 
  Box, 
  Container,
  Chip,
  IconButton,
  Tooltip
} from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CancelIcon from '@mui/icons-material/Cancel';
import InfoIcon from '@mui/icons-material/Info';
import { getAllTechnologies, validateTechnology } from '../data/technologies';

const TechnologyValidator = () => {
  const [inputValue, setInputValue] = useState('');
  const [selectedTech, setSelectedTech] = useState(null);
  const [isValid, setIsValid] = useState(null);
  const [options, setOptions] = useState([]);

  useEffect(() => {
    // Cargar todas las tecnologías
    setOptions(getAllTechnologies());
  }, []);

  const handleInputChange = (event, newValue) => {
    setInputValue(newValue);
    // Reset de la validación al cambiar el input
    setIsValid(null);
  };

  const handleSelection = (event, newValue) => {
    setSelectedTech(newValue);
    if (newValue) {
      // Validar si la tecnología seleccionada está en nuestro diccionario
      setIsValid(validateTechnology(newValue));
    } else {
      setIsValid(null);
    }
  };

  const handleValidate = () => {
    if (inputValue) {
      setIsValid(validateTechnology(inputValue));
    }
  };

  return (
    <Container maxWidth="md" sx={{ py: 4 }}>
      <Paper 
        elevation={3} 
        sx={{ 
          p: 4, 
          borderRadius: 2,
          backgroundColor: '#ffffff'
        }}
      >
        <Typography 
          variant="h4" 
          component="h1" 
          gutterBottom
          sx={{ 
            color: '#333',
            fontWeight: 600,
            textAlign: 'center',
            mb: 3
          }}
        >
          Diccionario de Tecnologías y Frameworks
        </Typography>

        <Box sx={{ mb: 3 }}>
          <Typography 
            variant="body2" 
            color="textSecondary"
            sx={{ mb: 1, textAlign: 'center' }}
          >
            Busca y valida si una tecnología está en nuestro diccionario de 125 tecnologías y 300 frameworks
          </Typography>
        </Box>

        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <Autocomplete
            fullWidth
            freeSolo
            id="tech-validator"
            options={options}
            value={selectedTech}
            onChange={handleSelection}
            inputValue={inputValue}
            onInputChange={handleInputChange}
            renderInput={(params) => (
              <TextField 
                {...params} 
                label="Tecnología o Framework" 
                variant="outlined"
                sx={{ 
                  '& .MuiOutlinedInput-root': {
                    borderRadius: 1.5,
                    backgroundColor: '#f9f9f9',
                  }
                }}
                onKeyPress={(e) => {
                  if (e.key === 'Enter') {
                    handleValidate();
                  }
                }}
              />
            )}
          />

          <Tooltip title="Validar">
            <IconButton 
              onClick={handleValidate}
              sx={{ 
                bgcolor: '#f0f0f0', 
                '&:hover': { bgcolor: '#e0e0e0' }
              }}
            >
              <InfoIcon />
            </IconButton>
          </Tooltip>
        </Box>

        {isValid !== null && (
          <Box 
            sx={{ 
              mt: 3, 
              p: 2, 
              borderRadius: 1.5, 
              bgcolor: isValid ? 'rgba(46, 125, 50, 0.08)' : 'rgba(211, 47, 47, 0.08)',
              display: 'flex',
              alignItems: 'center',
              gap: 1
            }}
          >
            {isValid ? (
              <>
                <CheckCircleIcon color="success" />
                <Typography variant="body1" color="success.main">
                  ¡La tecnología está registrada en nuestro diccionario!
                </Typography>
                <Chip 
                  label="Válida" 
                  color="success" 
                  size="small" 
                  sx={{ ml: 'auto' }}
                />
              </>
            ) : (
              <>
                <CancelIcon color="error" />
                <Typography variant="body1" color="error">
                  Esta tecnología no está en nuestro listado de 125 tecnologías y 300 frameworks.
                </Typography>
                <Chip 
                  label="No reconocida" 
                  color="error" 
                  size="small" 
                  sx={{ ml: 'auto' }}
                />
              </>
            )}
          </Box>
        )}
      </Paper>
    </Container>
  );
};

export default TechnologyValidator;
